import React from 'react'
import {Routes, Route } from 'react-router-dom'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Header from './component/Basics/header';

import Boxoffice from './component/Basics/Boxoffice';
import About1 from './component/Basics/About1';
import Login from './component/Basics/Login';




const App = () => {

  return (
    <>

      <Routes>

          <Route path="/" element={<Header />} />


          <Route path="/Home" element={<Boxoffice />} />
          <Route path="/about" element={<About1 />} />
          <Route path="/login" element={<Login />} />



      </Routes>
    </>



  )
}

export default App;
